import React from 'react'
import Carousel from 'react-bootstrap/Carousel'

let image = require("./images/download.jpg");


function FlipItem() {
    return (
        
        
       
                <Carousel.Item>   
                    
                    <img src={image.default} alt="image not found" />
                   
                    
                    <Carousel.Caption>
                    <h3></h3>
                    <p>Kanmani</p>
                    </Carousel.Caption>
        
                
                </Carousel.Item>
        
    )
}

export default FlipItem
